class Express_requests {
  api_query = async function (component, method="GET", data=null) {
    var request = {
      method: method,
    }
    if (data !== null) {
      request.headers= {
        'Content-Type': 'application/json',
      },
      request["body"] = JSON.stringify(data)
    }
    const value = await fetch(`api/components/${component}`, request);
    return value.json();
  }

}

export default Express_requests;
